window.bookSummaryJSON = "<p>Every girl has dreams of meeting Prince Charming, or at least I know I did. A fairy-tale-like meeting of love at first sight. Real life and fairy tales are very different. I'm just a small-town Indiana girl who had a chance encounter with one of Hollywood's golden boys. You may think you know where this story goes - not even close. Life is different. Marriage is hard. It's even worse when you're strangers. </p> <p>Contains mature themes. </p>"; 
